import { createStore } from "redux";
import { composeWithDevTools } from 'redux-devtools-extension';
import { AddFavouriteReducer } from "../Reducer/CombineRedusers";

const store = createStore(AddFavouriteReducer, composeWithDevTools());

export default store;
